import React, { useEffect, useState } from 'react';
import { Box, Typography, Grid, Paper, CircularProgress } from '@mui/material';
import mqtt from 'mqtt';

const MQTT_OPTIONS = {
  host: '34.170.31.196',
  port: 9001, // WebSocket
  protocol: 'wss', // Tenta WSS
  username: 'device_001',
  password: 'IoTDevice2024!',
  keepalive: 60,
  clean: true,
};

const TOPICS = {
  temperature: 'sensors/temperature/data',
  humidity: 'sensors/humidity/data',
  voltage: 'sensors/voltage/data',
  ethernet: 'sensors/ethernet/data',
};

function App() {
  const [data, setData] = useState({
    temperature: null,
    humidity: null,
    voltage: null,
    ethernet: null,
  });
  const [loading, setLoading] = useState(true);
  const [connected, setConnected] = useState(false);

  useEffect(() => {
    const url = `wss://${MQTT_OPTIONS.host}:${MQTT_OPTIONS.port}/mqtt`;
    const client = mqtt.connect(url, {
      username: MQTT_OPTIONS.username,
      password: MQTT_OPTIONS.password,
      keepalive: MQTT_OPTIONS.keepalive,
      clean: MQTT_OPTIONS.clean,
    });

    client.on('connect', () => {
      setConnected(true);
      Object.values(TOPICS).forEach(topic => client.subscribe(topic));
    });

    client.on('message', (topic, message) => {
      try {
        const payload = JSON.parse(message.toString());
        if (topic === TOPICS.temperature) {
          setData(prev => ({ ...prev, temperature: payload.temperature }));
        } else if (topic === TOPICS.humidity) {
          setData(prev => ({ ...prev, humidity: payload.humidity }));
        } else if (topic === TOPICS.voltage) {
          setData(prev => ({ ...prev, voltage: payload.voltage }));
        } else if (topic === TOPICS.ethernet) {
          setData(prev => ({ ...prev, ethernet: payload.status }));
        }
        setLoading(false);
      } catch (e) {
        // ignore parse errors
      }
    });

    client.on('error', () => setConnected(false));
    client.on('close', () => setConnected(false));

    return () => {
      client.end();
    };
  }, []);

  return (
    <Box sx={{ p: 4 }}>
      <Typography variant="h4" gutterBottom>
        Dashboard Sentinela IoT
      </Typography>
      <Typography variant="subtitle1" color={connected ? 'green' : 'red'}>
        {connected ? 'Conectado ao Broker MQTT' : 'Desconectado'}
      </Typography>
      <Grid columns={12} spacing={3} sx={{ mt: 2 }}>
        <Grid columnSpan={6}>
          <Paper sx={{ p: 3 }}>
            <Typography variant="h6">Temperatura</Typography>
            {loading ? <CircularProgress /> : <Typography variant="h3">{data.temperature ?? '--'} °C</Typography>}
          </Paper>
        </Grid>
        <Grid columnSpan={6}>
          <Paper sx={{ p: 3 }}>
            <Typography variant="h6">Umidade</Typography>
            {loading ? <CircularProgress /> : <Typography variant="h3">{data.humidity ?? '--'} %</Typography>}
          </Paper>
        </Grid>
        <Grid columnSpan={6}>
          <Paper sx={{ p: 3 }}>
            <Typography variant="h6">Tensão da Rede</Typography>
            {loading ? <CircularProgress /> : <Typography variant="h3">{data.voltage ?? '--'} V</Typography>}
          </Paper>
        </Grid>
        <Grid columnSpan={6}>
          <Paper sx={{ p: 3 }}>
            <Typography variant="h6">Status Ethernet</Typography>
            {loading ? <CircularProgress /> : <Typography variant="h3">{data.ethernet === 'ok' ? 'Normal' : 'Falha'}</Typography>}
          </Paper>
        </Grid>
      </Grid>
    </Box>
  );
}

export default App;
